import * as s from './App.styles';
import './App.css';

//components 
import Sidebar from './components/sidebar/sidebar'
import MainView from './components/MainView'



const App = () => {
  const backgroundImage = 'images/woman.jpg';
  const SidebarHeader='/LogoW.png'
  const menuItems = [
    {name:'Home', to:'/', icon: ''},
    {name:'Porfile', to:'/', icon: ''},
    {name:'Ubication', to:'/', icon: ''},
    {name:'Reports', to:'/', icon: ''},
    {name:'Chat', to:'/', icon: ''}
  ];
  return (
    <s.App>
      <Sidebar backgroundImage={backgroundImage} SidebarHeader={SidebarHeader} menuItems={menuItems}/>
      <MainView/>
    </s.App>

  )
}

export default App;
